import React from 'react'
import Card from './Card';
import data from './Services_data';


function start(val){
    return(
        <Card
            name1={val.name}
            image1={val.image}
        />
    )
        
}

const Services = () => {
  return (
    <>
    <div className='dibba'>
        {data.map(start)}
    </div>
    </>
  )
}

export default Services
